import React, { useState } from 'react';
import { Link } from "react-router-dom";
import styles from './Navbar.module.css'; // Import your CSS file for styling

const Navbar = () => {
    const [showSubMenu1, setShowSubMenu1] = useState(false);
    const [showSubMenu2, setShowSubMenu2] = useState(false);

    const toggleSubMenu1 = () => {
        setShowSubMenu1(!showSubMenu1);
        setShowSubMenu2(false);
    };

    const toggleSubMenu2 = () => {
        setShowSubMenu2(!showSubMenu2);
    };

    return (
        <nav className={styles.menu}>
            <ul>
                <li><Link to="/">Home</Link></li>
                <li onMouseEnter={toggleSubMenu1} onMouseLeave={toggleSubMenu1}>
                    <Link to="/qmgr">Ambientes QMGRs</Link>
                    {showSubMenu1 && (
                        <ul className={styles.submenu}>
                            <li onMouseEnter={toggleSubMenu2} onMouseLeave={toggleSubMenu2}><Link to="/qmgr/tu">TU</Link>
                                <li><Link to="/qmgr/tu/QM.BARE.TU">QM.BARE.TU</Link></li>
                                <li><Link to="/qmgr/tu/QM.BVP.TU">QM.BVP.TU</Link></li>
                                <li><Link to="/qmgr/tu/QM.CALLCENTER.TU">QM.CALLCENTER.TU</Link></li>
                                <li><Link to="/qmgr/tu/QM.DIGITAL.TU">QM.DIGITAL.TU</Link></li>
                                <li><Link to="/qmgr/tu/QM.HOLDING.TU">QM.HOLDING.TU</Link></li>
                                <li><Link to="/qmgr/tu/QM.SAUDE.TU">QM.SAUDE.TU</Link></li>
                            </li>
                            <li onMouseEnter={toggleSubMenu2} onMouseLeave={toggleSubMenu2}>
                                Team
                                {showSubMenu2 && (
                                    <ul className={styles.submenu}>
                                        <li>Management</li>
                                        <li>Staff</li>
                                    </ul>
                                )}
                            </li>
                            <li>History</li>
                        </ul>
                    )}
                </li>
                <li>Contact</li>
            </ul>
        </nav>
    );
};

export default Navbar;
